import React from 'react';
import Drawer  from './components/Drawer/Drawer';
import Player from './components/Player/Player';
import Content from './components/content1/content';
import './App.css';

function App() {
  return (
    <React.Fragment>
      <Drawer/>
      <Player/>
      <Content/>
    </React.Fragment>
  );
}

export default App;
